category_parameters.in_category:
наборы игрушечной детской посуды; наборы игрушечных продуктов; игрушечные овощи и фрукты; наборы игрушечной посуды с продуктами, овощами и фруктами; наборы игрушечной посуды с продуктами и фартуком/прихватками, корзиной, детские наборы для изготовления десертов из настоящих продуктов (но без ингредиентов в комплекте); игрушечные предметы посуды и кухонной утвари: кастрюли, чайники, подносы, скалки и т.д.
если набор для детей, в комплекте посуда и рецепты, нет ингредиентов, то в Игрушечную еду и посуду;
если есть пищевые ингредиенты, то в Смеси для приготовления десертов и напитков;
если есть ингредиенты, но набор позиционируется как набор для экспериментов на кухне, например молекулярная кухня, окрашивание продуктов и т.п., то Наборы для исследований.

